    SELECT product_accompaniments_join.id AS product_accompaniments_join_id, product_accompaniments_join.sn, product_accompaniments_join.product_id, product_accompaniments_join.product_accompaniments_id, product_accompaniments_join.price, product_accompaniments_join.active, product_accompaniments.name AS accompaniments_name, product_accompaniments.short_name AS accompaniments_short_name, product_accompaniments.active AS accompaniments_active, products.product_category_id, products.name AS product_name, products.price AS product_price FROM ((product_accompaniments_join LEFT JOIN product_accompaniments ON (((product_accompaniments_join.product_accompaniments_id)::text = (product_accompaniments.id)::text))) LEFT JOIN products ON (((product_accompaniments_join.product_id)::text = (products.id)::text)));


