COMMENT ON TABLE settings_cart IS '### force_address_add == Force User to Add Address As They logged On, set as customer logged on. ### discount_code_default == Discount Code Applys if not modifyed, set as customer logged on. live=client have to log in and live the system by clicking. It will send aggrement email, Agreement Will be stored in CWHD. inactive will be accessable by CWHD only.  ### cash_image = image used for send to kitchen. ### accompaniment_name = name, short_name, Will be selected from dropdown, will be applied to customer and client view ### product_name = Same as accompaniment_name, With kitchenName extra option ### meat_name = same as accompaniment_name  ### portion_size = same as accompaniment_name ### cash_accept = if cash payment is disable. ### enable_for_who =determine for_who option ### enable_product_note = determin note for each product. ### live_date = -2 means still not live, a time tell when became live for the first time. And this value never updates.';


