', 'We are located at sandhurst are committed to preserving a culture, tradition and standard in culinary tastes. It has been more than five years since THE KITCHEN delivery was established in sandhurst, UK. The Kitchen name has since become an icon of Indian cuisine in the area and established itself as the favored delivery of curry.<br /><br />

You will find our cuisine versatile, ranging from paying real homage to things that should celebrate the simple clean or delicate flavors to going all out in presenting you dishes that explode with flavors redolent of spice and heat. The menu features a wide range of cooking styles and dishes reflecting the diverse cuisine of the Indian sub-continent. We offer a richly-varied menu of high quality ingredients, wholesome sauces and house toasted spices and spice mixes. All of our food is freshly-prepared on the premises with a lot of love care and affection. Keeping in mind the ancient Indian cultural saying "Athithi Devo Bhava" (Guest is God) we put our guest ahead of us and thank you for patronizing our establishments. If you have any special needs, desires or requirements, we are just a click away. We will do our best that we can to please you.

