A: Registration is necessary for us to retrieve your data.

On the main page from The kitchens online, click on Signin and it will direct you to the registration page where you can input your login info. <br /><br />

Q: I cannot log in with my login info. <br /><br />

A: If you failed to login after few attempts, follow this step to retrieve your info: Click on Send me New Password > Input your email > Check your email box to find the temporary password. <br /><br />

NOTE: The email address must be the same with the one used for registration. If you forgot your email address, please send us query at contact us page. <br /><br />

Q: I forgot my password. <br /><br />

A: Retrieve your password by using send me New Password  and a temporary password will be sent to your email. You can change the password as soon as you login. <br /><br />

Q: Can I change/update my profile? <br /><br />

A: Yes, You can. Click on login and you can change/update your address or phone number.

